	var p = col_obj_w(C, col);
	o.write_shift(-4, C);
	o.write_shift(-4, C);
	o.write_shift(4, p.width * 256);
	o.write_shift(4, 0/*ixfe*/); // style
	o.write_shift(1, 2); // bit flag
